import { BrowserRouter as Router , Route, Switch } from 'react-router-dom';
import './App.css';
import Home from './prueba';

function App() {
  return (
      <div className="App">
    <Router>
      <Switch>
        <Route path="/prueba" component = {Home}></Route>
      </Switch>
        <h1>Hola</h1>
    );
    </Router>
    </div>
  )
}

export default App;
